import Header from "./composants/Header";
import { personne } from "./datas/data";

function App() {
  return (
    <div className="App">
        <ul>
            {personne.map((list, index)(
              <li key={index}>{list.nom}</li>
            ))}          
        </ul>
        <Header />
    </div>
  );
}

export default App;
